function About () {
    return(
        <div className="about">
            <h1 c>About This App</h1>
            <p>Welcome to our website, dedicated to providing information on thru hiking trails around the United States. We are passionate about hiking and the great outdoors, and we believe that thru hiking is one of the best ways to experience nature, challenge yourself, and create lasting memories.</p>
            <p>Thru hiking, also known as end-to-end hiking, involves hiking a long-distance trail from one end to the other, typically in one continuous journey. Thru hiking trails can vary in length, terrain, and difficulty, but they all offer the opportunity to immerse oneself in the natural beauty of the landscape and test one's physical and mental endurance.</p>
            <p>Our website aims to be a comprehensive resource for thru hiking enthusiasts, whether you are a seasoned thru hiker or a beginner planning your first thru hike. We provide detailed information on popular thru hiking trails, including trail maps, trail descriptions, and logistical information such as where to camp, resupply, and access transportation.</p>
            <p>In addition, we feature articles and resources on thru hiking gear, nutrition, and training, to help you prepare for your thru hike and make the most of your experience. We also welcome contributions from the thru hiking community, whether it's trail reports, gear reviews, or personal stories of your own thru hiking adventures.</p>
            <p>Thank you for visiting our website, and we hope that our information and resources inspire you to embark on your own thru hiking journey.</p>
       
       
        </div>
    )
}

export default About
